import {Component, OnInit} from '@angular/core';
import {CustomerService} from '../../services/customer.service';

@Component({
  selector: 'app-customer-dashboard',
  templateUrl: './customer-dashboard.component.html',
  styleUrls: ['./customer-dashboard.component.scss']
})
export class CustomerDashboardComponent implements OnInit {
  cars: any[] = [
    {
      id: 1,
      brand: 'Audi',
      name: 'A4',
      description: 'A luxurious and comfortable sedan.',
      price: 45000,
      color: 'Silver',
      transmission: 'Automatic',
      type: 'Sedan',
      year: 2022,
      processedImage: 'data:image/jpeg;base64,'
    },
    {
      id: 2,
      brand: 'BMW',
      name: 'X5',
      description: 'A spacious and powerful SUV.',
      price: 60000,
      color: 'White',
      transmission: 'Automatic',
      type: 'SUV',
      year: 2021,
      processedImage: 'data:image/jpeg;base64,'
    }
  ];

  constructor(private service: CustomerService) {
  }

  ngOnInit() {
    // Comment out the following line to use default data for testing
    // this.getAllCars();
  }

  getAllCars() {
    this.service.getAllCars().subscribe(res => {
      res.forEach((car: any) => {
        car.processedImage = `data:image/jpeg;base64,${car.returnedImage}`;
        this.cars.push(car);
      });
    });
  }
}
